sys_variable_value.value:
(function execute(inputs, outputs) {

  var domain = (inputs.domain) ? inputs.domain : "bit.ly";

  var obj = {
    "custom_bitlink" : domain + '/' + inputs.custom_back_end,
    "bitlink_id" : inputs.bitlink_id
  }

  outputs.payload = obj;

})(inputs, outputs);

